import React from 'react';
import image from '../../assets/img.jpg';
import img from '../../assets/dog2.jpg';

class Image extends React.Component {
    

    render() {

        return (
            <section class="">
                <figure class='image__logo'>
                    <img src= {image} />
                </figure>
                <figure class='image__footer'>
                    <img src= {img} />
                </figure>
            </section>
        );
    }

}

export default Image;
